import React, { useState } from "react";
import "../../styles/flowTwo/StepTwo2.css";
import Header from "../UserFlowOne/Header";
import Footer from "./Footer";

const DriverInfo = () => {
  const [form, setForm] = useState({
    insured: true,
    insuredForYear: true,
    sr22: false,
    dui: false,
    homeOwner: true,
    military: false,
    accidents: "0",
    creditScore: "Good",
  });

  const handleToggle = (key) => {
    setForm((prev) => ({ ...prev, [key]: !prev[key] }));
  };

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  return (
    <div>
      <Header />
      <div className="driver-info-container">
        <h2>Driver's Information</h2>
        <div className="driver-form">
          <div className="form-group">
            <label>First and Last Name</label>
            <input type="text" placeholder="John Doe" />
          </div>
          <div className="form-group">
            <label>Date of Birth</label>
            <input type="date" />
          </div>
          <div className="form-group">
            <label>Gender</label>
            <div className="gender-toggle">
              <button
                className={form.gender === "male" ? "active" : ""}
                onClick={() => setForm({ ...form, gender: "male" })}
              >
                Male
              </button>
              <button
                className={form.gender === "female" ? "active" : ""}
                onClick={() => setForm({ ...form, gender: "female" })}
              >
                Female
              </button>
            </div>
          </div>
          <div className="form-group">
            <label>Marital Status</label>
            <select name="maritalStatus" onChange={handleChange}>
              <option value="single">Single</option>
              <option value="married">Married</option>
            </select>
          </div>
          <div className="form-group">
            <label>Are you currently insured?</label>
            <ToggleButton
              active={form.insured}
              onToggle={() => handleToggle("insured")}
            />
          </div>
          <div className="form-group">
            <label>Have you been insured for at least a year?</label>
            <ToggleButton
              active={form.insuredForYear}
              onToggle={() => handleToggle("insuredForYear")}
            />
          </div>
          <div className="form-group">
            <label>Current Insurer</label>
            <select name="currentInsurer" onChange={handleChange}>
              <option value="Other">Other</option>
              <option value="Geico">Geico</option>
              <option value="StateFarm">State Farm</option>
            </select>
          </div>
          <div className="form-group">
            <label>Has your state notified you to file an SR22?</label>
            <ToggleButton
              active={form.sr22}
              onToggle={() => handleToggle("sr22")}
            />
          </div>
          <div className="form-group">
            <label>Do you have any DUIs in the past 3 years?</label>
            <ToggleButton
              active={form.dui}
              onToggle={() => handleToggle("dui")}
            />
          </div>
          <div className="form-group">
            <label>Do you own a home?</label>
            <ToggleButton
              active={form.homeOwner}
              onToggle={() => handleToggle("homeOwner")}
            />
          </div>
          <div className="form-group">
            <label>Military Affiliation?</label>
            <ToggleButton
              active={form.military}
              onToggle={() => handleToggle("military")}
            />
          </div>
          <div className="form-group">
            <label>At fault accidents in the last 3 years?</label>
            <select name="accidents" onChange={handleChange}>
              <option value="0">0</option>
              <option value="1">1</option>
              <option value="2">2</option>
            </select>
          </div>
          <div className="form-group">
            <label>Credit Score</label>
            <select name="creditScore" onChange={handleChange}>
              <option value="Good">Good</option>
              <option value="Average">Average</option>
              <option value="Poor">Poor</option>
            </select>
          </div>
        </div>
        <button className="next-step">Next Step</button>
      </div>
      <Footer />
    </div>
  );
};

const ToggleButton = ({ active, onToggle }) => (
  <div className="toggle">
    <button
      className={`toggle-option ${active ? "active" : ""}`}
      onClick={onToggle}
    >
      Yes
    </button>
    <button
      className={`toggle-option ${!active ? "active" : ""}`}
      onClick={onToggle}
    >
      No
    </button>
  </div>
);

export default DriverInfo;
